import React from 'react';
import logo from './logo.svg';
import './App.css';
import WishMessage from './component/WishMessage';


function App() {
  return (
    <div className="App">
      <nav className="navbar navbar-dark bg-dark">
       <a href="/" className="navbar-brand">Events in React JS</a>
      </nav>
     <WishMessage/>
    </div>
  );
}

export default App;
